import React from "react";
import "../styles/Categories.css";

const Categories = () => {
  return (
    <div>
      <h2>Categories:</h2>
      <div className="categories--card">
        <p style={{ color: "aqua" }}>Burgers</p>
      </div>
      <div className="categories--card">
        <p>Pizza</p>
      </div>
      <div className="categories--card">
        <p>Pasta</p>
      </div>
      <div className="categories--card">
        <p>Sushi</p>
      </div>
      <div className="categories--card">
        <p>Salats</p>
      </div>
    </div>
  );
};

export default Categories;
